      field: "requests",
      aggFunc: "sum",
      headerName: 'Requests',
      cellStyle: params => params.node.group ? { fontWeight: 'bold', textAlign: 'center' } : { fontWeight: 'normal', textAlign: 'center' }
    },
    {
      field: "errors",
      aggFunc: "sum",
      headerName: 'Errors',
      cellStyle: params => params.node.group ? { fontWeight: 'bold', textAlign: 'center' } : { fontWeight: 'normal', textAlign: 'center' }
    },
  ];

  defaultColDef: ColDef = {
    sortable: false,
    cellStyle: { textAlign: 'center'},
    headerClass: 'align-center',
    resizable: false,
    suppressMovable: true,
    flex: 1
  };
}

