    dialogRef.afterClosed().subscribe((result) => {
      if (result) {
        if (result.$event?.data === 'save') {
          // this.store.dispatch(updateBot({isSendData: result.data, id: rowData.id}));
        }
      } else {
        console.log('Info Closed');
      }
